import { Box, Grid, ImageList, ImageListItem, Typography } from "@material-ui/core";
import Mansonry, { ResponsiveMasonry } from "react-responsive-masonry";



function AboutMe() {
    return (
        <Box sx={{ height: 1, backgroundColor: 'error.main' }} >
            <ResponsiveMasonry
                columnsCountBreakPoints={{ 350: 1, 750: 2, 900: 3 }}>
                <Masonry>

                </Masonry>
            </ResponsiveMasonry>

        </Box>
    )
}

export default AboutMe;
